INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (1, 1, 'Excepturi similique error voluptas quia assumenda vel tenetur qui.', 'Sint animi harum earum consequatur veritatis occaecati impedit. Voluptate occaecati necessitatibus totam error sed sapiente non. Dignissimos qui quae maiores rerum quia libero quis.', 'Tempora dolorem qui ipsum dignissimos. Doloribus nobis cupiditate ipsam rerum. Autem optio odio dolorum ut. Et quis non inventore aut.', '2003-06-25');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (2, 1, 'Est quia ut fuga.', 'Ut voluptatem distinctio a possimus. Rerum numquam autem numquam quia. Saepe mollitia modi minus aliquam.', 'Commodi nisi sint quam omnis vitae qui qui ex. Nihil ut accusamus et delectus sed ducimus ratione. Dolorem itaque qui dignissimos laborum minima eligendi.', '2014-02-02');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (3, 1, 'Rem rerum qui consequuntur.', 'Laboriosam odit commodi qui et ipsa doloremque. Qui non aliquid voluptas libero perferendis. Quibusdam consequatur ut reiciendis est similique. Sequi aut odit eveniet autem repellendus.', 'Sint eius ea eius deserunt cum odit. Dolor aliquam maiores qui voluptatum aperiam veniam non. Consequatur ullam iusto qui aut pariatur non. Voluptatibus sint sunt quia.', '2001-01-22');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (4, 2, 'Nisi occaecati rerum eveniet.', 'Placeat non rerum perferendis officiis. Occaecati aliquid aperiam error. Modi voluptatum sequi aspernatur est nemo distinctio sed quia. Nihil pariatur officiis dolore id quas aut autem.', 'Est ut sequi ex velit. Enim quidem architecto quod possimus. Eos laudantium quam incidunt commodi.', '2005-06-26');
